import logo from './logo.svg';
import './App.css';
import Loginsignup from './components/loginsignup/Loginsignup';
import Home from './components/Home/Home';
import Add_Expense from './components/add-expense/Add-expense';
import Show_expense from './components/show-expense/Show-expense';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AddExpense from './components/add-expense/Add-expense';

function App() {
  return (

      <div>
        <Routes>
          <Route path="/" element={<Loginsignup />} />
          <Route path="/home" element={<Home />} />
          <Route path="/add-expense" element={<Addexpense />} />
          <Route path="/show-expense" element={<Show_expense />} />

        </Routes>
      </div>

  );
}
export default App;
